import React from 'react';
import styled from 'styled-components';
import {Box, Button} from '@material-ui/core'
import s from '../../styles/styles.module.css'


const Hero = () =>  (
            <Box p={2} color="seconday">
            <Text>
              <h1>
              A marketplace for artificial intelligence
              </h1>

              <p ><strong>Choose a data source</strong></p>
              <span >Streaming video, image, text, or unstructured</span>

              <p ><strong>Choose a model</strong></p>

              <p ><strong>Choose how to get results</strong></p>
              <span>Dashboard, streaming JSON, or API</span>
              </Text>
              <Button size="large" className={s.whiteButton} href="#contact">
                Contact Us
              </Button>



            </Box>
    )

    const Text = styled.p`
    color: white;
    text-align: left;
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
    `

export default Hero;
